INSERT INTO `wx_mind` (`id`, `title`, `intro`, `image_url`, `content`, `score_scale`, `score_radius_result`, `created_datetime`) VALUES ('1', '抑郁自评量表（SDS）', 'SDS按症状出现频度评定，分4个等级：没有或很少时间，少部分时间，相当多时间，绝大部分或全部时间。若为正向评分题，依次评为粗分l、2、3、4。反向评分题，则评为4、3、2、1。 评定时间为过去一周内，把个题的得分相加为粗分，粗分乘以1.25，四舍五入取整数即得到标准分。抑郁评定的领临界值为T=53，分值越高，抑郁倾向越明显。', '1.png', , 1.25, '[{\"max\": 52, \"min\": 0, \"result\": \"正常\"}, {\"max\": 62, \"min\": 53, \"result\": \"轻度抑郁\"}, {\"max\": 72, \"min\": 63, \"result\": \"中度抑郁\"}, {\"max\": 300, \"min\": 72, \"result\": \"中度抑郁\"}]', '2024-02-10 14:13:20');
INSERT INTO `wx_mind` (`id`, `title`, `intro`, `image_url`, `content`, `score_scale`, `score_radius_result`, `created_datetime`) VALUES ('1756243002864455682', '汉密顿抑郁量表（HAMD）', '0-6分正常\n\n\n\n无抑郁症，一切正常。\n\n\n\n事实上，一段时间的心情低落、悲观消极属于正常现象，不一定是患上了抑郁症，很可能只是正常的抑郁情绪波动而已，并非上升到了病理性质。\n\n\n\n7-16分可能有抑郁症\n\n\n\n有抑郁倾向，注意调整自己的心情。\n\n\n\n事实上，抑郁症这种疾病其实根本不可怕，只要正视它、面对它，去医院看病，医生会帮助你，给你开相应的药物，其实服药主要是为了调整你脑部的各种物质，比如大家所知的5-羟色胺。\n\n\n\n除了药物治疗心理治疗也是必不可少的，心理咨询可以帮助你打开心结。\n\n\n\n除了这两项专业的治疗还有就是物理治疗就是运动，运动可以提高身体的素质以及激素。\n\n\n\n三种方式一起，只要你肯努力，相信不久的将来你的病情就会得到康复。\n\n\n\n17-24分有抑郁症的概率较大\n\n\n\n应借助自身调节与专业心理治疗来进行治疗。', '2024-02-10/3/1707555775764health-education.png', 0x3C703EE5958AE5AE9EE68993E5AE9EE5A4A73C2F703E, 1.00, '[{\"max\": 6, \"min\": 0, \"result\": \"正常\"}, {\"max\": 16, \"min\": 7, \"result\": \"抑郁\"}, {\"max\": 300, \"min\": 17, \"result\": \"中度抑郁\"}]', '2024-02-10 17:05:36');
INSERT INTO `wx_mind` (`id`, `title`, `intro`, `image_url`, `content`, `score_scale`, `score_radius_result`, `created_datetime`) VALUES ('1756269761541505026', '人际关系综合诊断量表', '总分0－8分之间：说明你在与朋友相处上的困扰较少。你善于交谈，性格比较开朗，主动，关心别人，你对周围的朋友都比较好，愿意和他们在一起，他们也都喜欢你，你们相处得不错。而且，你能够从与朋友相处中，得到乐趣。你的生活是比较充实而且丰富多彩的，你与异性朋友也相处得比较好。一句话，你不存在或较少存在交友方面的困扰，你善于与朋友相处，人缘很好，获得许多的好感与赞同。\n\n总分9－14分之间：你与朋友相处存在一定程度的困扰。你的人缘很一般，换句话说，你和朋友的关系并不牢固，时好时坏，经常处在一种起伏波动之中。\n\n总分15－28分之间：你在同朋友相处上的行为困扰较严重，分数超过20分，则表明你的人际关系困扰程度很严重，而且在心理上出现较为明显得障碍。你可能不善于交谈，也可能是一个性格孤僻的人，不开朗，或者有明显得自高自大、讨人嫌的行为。', '2024-02-10/3/1707562248794psychological-counseling.png', 0x3C703E61646173643C2F703E, 1.00, '[{\"max\": 8, \"min\": 0, \"result\": \"善于交谈，性格比较开朗，主动，关心别人，你对周围的朋友都比较好，愿意和他们在一起，他们也都喜欢你，你们相处得不错。而且，你能够从与朋友相处中，得到乐趣。你的生活是比较充实而且丰富多彩的，你与异性朋友也相处得比较好。一句话，你不存在或较少存在交友方面的困扰，你善于与朋友相处，人缘很好，获得许多的好感与赞同\"}, {\"max\": 14, \"min\": 9, \"result\": \"你与朋友相处存在一定程度的困扰。你的人缘很一般，换句话说，你和朋友的关系并不牢固，时好时坏，经常处在一种起伏波动之中\"}, {\"max\": 300, \"min\": 15, \"result\": \"你在同朋友相处上的行为困扰较严重，分数超过20分，则表明你的人际关系困扰程度很严重，而且在心理上出现较为明显得障碍。你可能不善于交谈，也可能是一个性格孤僻的人，不开朗，或者有明显得自高自大、讨人嫌的行为\"}]', '2024-02-10 18:51:56');
